



/* product 생성 */
SELECT DISTINCT product_name
FROM mart_info;

/* join_mart 생성 */
SELECT DISTINCT store
FROM mart_info;

/* mart_product 생성 */
SELECT CAST(mi.sale_price AS SIGNED) AS price, mi.manufacturer, jm.join_id, p.product_id
FROM mart_info mi
        JOIN product p ON mi.product_name = p.product_name
        JOIN join_mart jm ON mi.store = jm.store
WHERE mi.store LIKE 'GS%';

SELECT CAST(mi.sale_price AS SIGNED) AS price, mi.manufacturer, jm.join_id, p.product_id
FROM mart_info mi
         JOIN product p ON mi.product_name = p.product_name
         JOIN join_mart jm ON mi.store = jm.store
WHERE mi.store LIKE '이마트';

SELECT CAST(mi.sale_price AS SIGNED) AS price, mi.manufacturer, jm.join_id, p.product_id
FROM mart_info mi
         JOIN product p ON mi.product_name = p.product_name
         JOIN join_mart jm ON mi.store = jm.store
WHERE mi.store LIKE '농협';

SELECT CAST(mi.sale_price AS SIGNED) AS price, mi.manufacturer, jm.join_id, p.product_id
FROM mart_info mi
         JOIN product p ON mi.product_name = p.product_name
         JOIN join_mart jm ON mi.store = jm.store
WHERE mi.store LIKE '롯데';
